var expect=chai.expect;describe("CSV",function(){var a;beforeEach(function(){a=sinon.sandbox.create(),a.stub(window.console,"log"),a.stub(window.console,"error")}),afterEach(function(){a.restore()}),describe("funcion calculate",function(){it("deberia aceptar una cadena",function(){var a='"hola"',e=calculate(a);expect(e[0].value[0]).to.equal("hola")}),it("prueba con una coma a la derecha",function(){var a='"hola,"',e=calculate(a);expect(e[0].value[0]).to.equal("hola,")}),it("prueba con una coma a la izquierda",function(){var a='",hola"',e=calculate(a);expect(e[0].value[0]).to.equal(",hola")}),it("prueba con espacios",function(){var a='" hola"',e=calculate(a);expect(e[0].value[0]).to.equal(" hola")}),it("prueba separando con comas",function(){var a='"hola","adios"',e=calculate(a);expect(e[0].value[0]).to.equal("hola"),expect(e[0].value[1]).to.equal("adios")}),it("prueba separando con comas y habiendo espacios",function(){var a=' ,"adios"',e=calculate(a);expect(e[0].value[0]).to.equal(" "),expect(e[0].value[1]).to.equal("adios")}),it("prueba separando con dos comas seguidas",function(){var a='"hola",,"adios"',e=calculate(a);expect(e[0].value[0]).to.equal("hola"),expect(e[0].value[1]).to.equal(""),expect(e[0].value[2]).to.equal("adios")})})});